import React, { useState, useEffect } from 'react';
import { motion } from 'framer-motion';

const VyvsaiAnimation = () => {
  const [isPlaying, setIsPlaying] = useState(true);

  useEffect(() => {
    // Reset animation after it completes
    const timer = setTimeout(() => {
      setIsPlaying(false);
      setTimeout(() => setIsPlaying(true), 100);
    }, 10000); // Adjust based on total animation duration

    return () => clearTimeout(timer);
  }, [isPlaying]);

  return (
    <div className="flex justify-center items-center w-full h-full">
      <svg viewBox="0 0 800 600" className="w-full max-w-screen-lg h-auto">
        {/* Background */}
        <rect width="100%" height="100%" fill="#f0f0f0" />

        {/* Chaotic construction site */}
        <motion.g
          initial={{ opacity: 1 }}
          animate={{ opacity: isPlaying ? [1, 0] : 1 }}
          transition={{ duration: 2, times: [0, 1] }}
        >
          <rect x="100" y="300" width="600" height="200" fill="#d3d3d3" />
          <polygon points="100,300 400,100 700,300" fill="#a9a9a9" />
          <rect x="200" y="350" width="50" height="150" fill="#8b4513" />
          <rect x="550" y="350" width="50" height="150" fill="#8b4513" />
          <circle cx="300" cy="450" r="30" fill="#ff0000" />
          <circle cx="500" cy="400" r="30" fill="#0000ff" />
          <rect x="375" y="150" width="10" height="150" fill="#ffd700" />
          <rect x="330" y="140" width="100" height="10" fill="#ffd700" />
        </motion.g>

        {/* Worker with device */}
        <circle cx="300" cy="450" r="20" fill="#2196f3" />
        <rect x="290" y="420" width="20" height="30" fill="#2196f3" />

        {/* Notification popup */}
        <motion.g
          initial={{ scale: 0 }}
          animate={{ scale: isPlaying ? [0, 1] : 0 }}
          transition={{ duration: 1, delay: 6 }}
        >
          <rect x="320" y="380" width="100" height="60" rx="10" fill="#ffffff" stroke="#000000" />
          <text x="370" y="410" textAnchor="middle" fontSize="12">New Tender!</text>
        </motion.g>

        {/* Final completed project */}
        <motion.g
          initial={{ opacity: 0 }}
          animate={{ opacity: isPlaying ? [0, 1] : 0 }}
          transition={{ duration: 2, delay: 8 }}
        >
          <rect x="200" y="100" width="400" height="400" fill="#3f51b5" />
          <rect x="250" y="150" width="100" height="100" fill="#bbdefb" />
          <rect x="450" y="150" width="100" height="100" fill="#bbdefb" />
          <rect x="250" y="300" width="100" height="100" fill="#bbdefb" />
          <rect x="450" y="300" width="100" height="100" fill="#bbdefb" />
        </motion.g>

        {/* Final Vyvsai logo */}
        <motion.g
          initial={{ opacity: 0 }}
          animate={{ opacity: isPlaying ? [0, 1] : 0 }}
          transition={{ duration: 2, delay: 10 }}
        >
          <text x="400" y="550" textAnchor="middle" fontSize="48" fill="#000000">Vyvsai</text>
        </motion.g>
      </svg>
    </div>
  );
};

export default VyvsaiAnimation;
